import React from 'react';
import './App.css';

// import containers
import MainPage from './containers/MainPage';

export default function App() {
  let component;
  switch (window.location.pathname) {
      case "/":
          component = <MainPage />;
          break;
      default:
          component = <MainPage />;
  }
  return(
      <>
          {component}
      </>
  )
}
